import React from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
    state = {
        jwtControler: new JwtControler(),
    };

    return (
        <div className="App">
            <button onClick={state.jwtControler.authenticate("joao", "joao")}>
                It hurts
            </button>
        </div>
    );
}

export default App;
